given_directions = ['',
                    '',
                    '',
                    '',
                    '']

dir_lookups = dict(
    L=(-1, 0),
    U=(0, 1),
    R=(1, 0),
    D=(0, -1)
)

numbs = {}
numbs[(0,2)] = 1
numbs[(1,2)] = 2
numbs[(2,2)] = 3

numbs[(0,1)] = 4
numbs[(1,1)] = 5
numbs[(2,1)] = 6

numbs[(0,0)] = 7
numbs[(1,0)] = 8
numbs[(2,0)] = 9


def update_value(cur, delta):

    x = cur[0] + delta[0]
    y = cur[1] + delta[1]

    if x > 2: x = 2
    if x < 0: x = 0
    if y > 2: y = 2
    if y < 0: y = 0

    return x, y

def get_numb(starting_loc, dirs):
    loc = starting_loc
    for d in dirs:
        loc = update_value(loc, dir_lookups[d])

    return loc

def get_locs():

    loc = (1, 1)
    s = ''
    for d in given_directions:
        loc = get_numb(loc, d)
        s += str(numbs[loc])

    return s





assert (numbs[get_numb((1,1), 'ULL')] == 1)
assert (numbs[get_numb((0,1), 'RRDDD')] == 9)
assert (numbs[get_numb((2,0), 'LURDL')] == 8)
assert (numbs[get_numb((1,0), 'UUUUD')] == 5)

print(get_locs())

